        "title": "GoPro: Top 10 Scariest Moments",
        "description": "GoPro cameras have captured everything from insane championship titles to treacherous tumbles + everything in between. Today, we are focusing on the wildest shots that made our hearts stop + toes curl. Countdown some of the scariest moments recorded on a GoPro:\n\n0:23 High-speed hydroplane boat crash from H1 Unlimited Hydroplanes 🚤\n0:38 Rafael Bridi highlining between Hot Air Balloons 🎈🎈\n1:09 Lukas Reilly meets a wild Orca Whale on his SUP 🐋\n1:40 Skiing into a crevasse with Jaimie Mullner ⛷\n2:56 GoPro Athlete Jason Paul's handstand atop a skyscraper 🏙\n3:26 Geddy Pratt clears the canyon on a MTB 🚲\n3:56 GoPro Athlete Kai Lenny gets caught on the inside while surfing at Nazaré 🌊\n4:54 Andy Lewis has a parachute malfunction while BASE jumping 🪂\n4:59 The longest 4-wheel vehicle jump attempt with Guerlain Chicherit 🚗\n7:34 Johan Potgieter goes face-to-face with a Great White Shark while spearfishing 🦈\n\n----------------------------------------------------------------\nShop our camera lineup:\nHERO11 Black: https://GoPro.com/HERO11Black\nHERO11 Black Mini: https://GoPro.com/HERO11Mini\nHERO11 Black Creator Edition: https://GoPro.com/CreatorEdition\nMAX: https://GoPro.com/MAX\n-----------------------------------------------------------------\nShot 100% on GoPro: https://bit.ly/3DeeCEE\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\nMusic Courtesy of Epidemic Sound\nhttps://www.epidemicsound.com/\n\n\nFor more from GoPro, follow us:\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTikTok: https://www.tiktok.com/@gopro\nThe Current: https://gopro.com/news\nGoPro: https://gopro.com/channel/\n#GoPro #GoProHERO11 #GoProMAX #HyperSmooth #Top10 #TopTen #Countdown",
